        static int Psum(int[] arr)
        {
            List<int> pos = new List<int>();
            List<int> neg = new List<int>();
            foreach (var item in arr)
            {
                if(item >= 0)
                {
                    pos.Add(item);
                }
                else
                {
                    if (neg.Count > 0)
                    {
                        var last = neg[neg.Count - 1];
                        if (last < item)
                        {
                            neg[neg.Count - 1] = item;
                            neg.Add(last);
                        }
                        else
                        {
                            neg.Add(item);
                        }
                    }
                    else
                    {
                        neg.Add(item);
                    }
                } 
            }
            pos.AddRange(neg);
            int sum = 0;
            int count = 0;
            for (int i = 0; i < pos.Count; i++)
            {
                sum += pos[i];
                pos[i] = sum;
                if (pos[i] > 0) count++;
                Console.WriteLine(pos[i]);
            }
            return count;
        }
        static bool Fun(int[] flowerbed, int n)
        {
            int count = 0;
            if (flowerbed.Length == 0)
            {
                if (n == 0) return true;
                else return false;
            }
            if (flowerbed.Length == 1 )
            {
                if (flowerbed[0] == 0 && n <= 1) return true;
                else if (flowerbed[0] == 1 && n == 0) return true;
                else return false;
            }
            if (flowerbed.Length == 2 && (flowerbed[0] == 0 || flowerbed[1] == 0))
            {
                if (n <= 1) return true;
                else return false;
            }
            if (flowerbed[0] == 0 && flowerbed[1] == 0)
            {
                flowerbed[0] = 1;
                count++;
            }
            for (int i = 1; i < flowerbed.Length - 1; i++)
            {
                if (flowerbed[i] == 0 && flowerbed[i - 1] != 1 && flowerbed[i + 1] != 1)
                {
                    count++;
                    flowerbed[i] = 1;
                }
            }
            if (flowerbed[flowerbed.Length - 2] == 0 && flowerbed[flowerbed.Length - 1] == 0)
            {
                flowerbed[flowerbed.Length - 1] = 1;
                count++;
            }

            return count >= n;
        }
        static int NumberOfSpecialChars(string word)
        {
            HashSet<char> set = new HashSet<char>();
            HashSet<char> removed = new HashSet<char>();
            int count = 0;
            string str = "";
            foreach (char ch in word)
            {
                str += ch;
                if (!set.Contains(ch))
                {
                    if (char.IsLower(ch) && word.Contains(char.ToUpper(ch)) && !str.Contains(char.ToUpper(ch)))
                    {
                        set.Add(ch);
                        count++;
                    }
                }
                else
                {
                    if (!removed.Contains(ch) && str.Contains(char.ToUpper(ch)))
                    {
                        removed.Add(ch);
                        count--;
                    }
                }
            }

            return count;
        }
        static long LargestSquareArea(int[][] bottomLeft, int[][] topRight)
        {
            long area = 0;
            for (int i = 0; i < topRight.Length - 1; i++)
            {
                for (int j = i + 1; j < topRight.Length; j++)
                {
                    int nextLeftX = bottomLeft[j][0];
                    int nextRightX = topRight[j][0];
                    int currentLeftX = bottomLeft[i][0];
                    int currentRightX = topRight[i][0];

                    int nextBottomY = bottomLeft[j][1];
                    int nextTopY = topRight[j][1];
                    int currentBottomY = bottomLeft[i][1];
                    int currentTopY = topRight[i][1];

                    long len = 0, wid = 0;
                    if (nextLeftX >= currentLeftX && nextLeftX <= currentRightX)
                    {
                        len = currentRightX - nextLeftX;
                        if (nextRightX <= currentRightX)
                        {
                            len = nextRightX - nextLeftX;
                        }

                    }
                    else if (nextLeftX < currentLeftX && nextRightX > currentLeftX)
                    {
                        len = nextRightX - currentLeftX;
                        if (nextRightX > currentRightX)
                        {
                            len = currentRightX - currentLeftX;
                        }
                    }
                    if (nextBottomY >= currentBottomY && nextBottomY <= currentTopY)
                    {
                        wid = currentTopY - nextBottomY;
                        if (nextTopY <= currentTopY)
                        {
                            wid = nextTopY - nextBottomY;
                        }
                    }
                    else if (nextBottomY < currentBottomY && nextTopY > currentBottomY)
                    {
                        len = nextTopY - currentBottomY;
                        if (nextTopY > currentTopY)
                        {
                            len = currentTopY - currentBottomY;
                        }
                    }
                    if (len == wid && len * wid > area)
                    {
                        area = len * wid;
                    }
                }
            }
            return area;
        }

        static (int, string) Run(string input)
        {
            int count = 1, prevCount = 1;
            string str = input[0].ToString(), prevStr = input[0].ToString();
            for (int i = 1; i < input.Length; i++)
            {
                if (input[i] == input[i - 1])
                {
                    count++;
                    str += input[i].ToString();
                }
                else
                {
                    if (count >= prevCount)
                    {
                        prevCount = count;
                        prevStr = str;
                        str = input[i].ToString();
                        count = 1;
                    }
                }
            }
            return (count >= prevCount ? count : prevCount, count >= prevCount ? str : prevStr);

        }

